import axios from "axios";
import { localhost } from "./urls";
// import { Token } from "./constants";

function Token() {
  const user = JSON.parse(localStorage.getItem("user"));
  const Token = user.token;
  return Toekn;
}
export const authAxios = axios.create({
  Token: Token,
  baseURL: localhost,
  headers: {
    Authorization: Token
  }
});
